import React from 'react';
import QuoteText from './QuoteText';

class QuoteBox extends React.Component {
  render() {
    return (
      <div>
        <QuoteText quote="We love React" author="Facebook" />
        <button value="New quote" />
      </div>
    );
  }
}

export default QuoteBox;
